import logo from './logo.svg';
import './App.css';
import {MainApp} from './components/MainAppComponent'
import { BrowserRouter as Router } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <MainApp/>
      </div>
    </Router>
  );
}

export default App;
